function leftMostExactOrGreater(val,arr,comparer,startPos,endPos){var left=startPos,right=endPos;while(left<right){var mid=left+Math.floor((right-left)/2);if(comparer(arr[mid],val)<0){left=mid+1}else{right=mid}}return left}function rightMostExactOrLesser(val,arr,comparer,startPos,endPos){var left=startPos,right=endPos;while(left<right){var mid=left+Math.floor((right-left)/2);if(comparer(arr[mid],val)>0){right=mid}else{left=mid+1}}return left-1}export{leftMostExactOrGreater,rightMostExactOrLesser};